    return (
        <div className='Preflop'>
            <h3>flop Content</h3>
            <button onClick={() => { setGameState("preflop") }}>previous</button>
            <button onClick={() => { setGameState("turn") }}>next</button>
        </div>

    )
}

export default Flop
